import React from "react";
import "./style.css"

function QuickAccessInstructor() {
  return (
<div class="jumbotron text-center">
  <div class="overlay">
  </div>
  <div class="background-image">
  </div>
  <div class="caption">
    <h1>14</h1>
    <p>Submitted</p>
  </div>
</div>
  );
}

export default QuickAccessInstructor;
